import React from 'react';
import { Typography, Box, Paper, Stack } from '@mui/material';

const HMCInternship = () => {
  const studentData = {
    personalInfo: {
      name: 'John Doe',
      fatherName: 'Mr. Richard Doe',
      rollNo: 'MHM2023012',
      completionMonthYear: 'June 2025',
      internshipFrom: '01/01/2025',
      internshipTo: '31/03/2025',
    }
  };

  return (
    <Paper elevation={3} sx={{ 
      padding: 3, // Reduced from 4
      margin: 2,
      backgroundColor: 'background.paper' // Explicit background
    }}>
      <Stack spacing={2}> {/* Reduced spacing */}
        {/* Personal Information Section */}
        <Box sx={{ pt: 1 }}> {/* Added top padding */}
          <Typography 
            variant="h5" 
            gutterBottom 
            sx={{ 
              fontWeight: 'bold',
              color: 'text.primary',
              fontSize: '1.5rem', // Explicit size
              lineHeight: 1.2
            }}
          >
            Internship & Final Completion Details
          </Typography>

          <Box sx={{ 
            display: 'flex', 
            flexDirection: 'column', 
            gap: 1.5,
            mt: 2,
            pl: 1 // Small left padding
          }}>
            {/* Info items */}
          </Box>
        </Box>
      </Stack>
    </Paper>
  );
};

export default HMCInternship;
